import "./land.css";

const Land = () => {

    return (
      <div class="wrapper">

            <div class="side left">
                  <div class="image dog"></div>
                  <div class="caption">
                        <h1>ETH</h1>
                        <a class="button" href="#">See our dogs</a>
                  </div>
            </div>

            <div class="side right">
                  <div class="image cat"></div>
                  <div class="caption">
                        <h1>SOL</h1>
                        <a class="button" href="#">See our cats</a>
                  </div>
            </div>
      </div>
    );
} 

export default Land;
